import styled from "styled-components";



export default BabyLion;

const Wrapper = styled.div`
	display: flex;
	align-items: center;
	height: 3vh;
	padding: 0.5rem 1rem;
	gap: 0.8rem;
	border-radius: 0.8rem;
`;

const Name = styled.div`
	font-weight: 800;
	opacity: 0.8;

    @media (max-width: 1100px) {
    font-size: 20px;
	}
	@media (min-width: 1100px) and (max-width: 1700px) {
    font-size: 22px;
	}
`;
